import logo from './logo.svg';
import './App.css';
import Navbar from './Components/UI/Navbar';

function App() {
  return (
    <div className="App">
      <div className='border border-black border-5 shadow '>
        <h1>Don't worry. We got you Covered</h1>
        <p>Covered is a simple cover letter generator </p>
        <p>Tell Covered who you are and Covered will tell them why you would make a great fit.</p>
      </div>
      <Navbar></Navbar>
    </div>
  );
}

export default App;
